import {connect} from "react-redux";
import {bindActionCreators} from "redux";
import TranslationsPage from './translationsPage';
import {getTranslations} from '../../../redux/lang/actions'

const mapDispatchToProps = dispatch => {
    return bindActionCreators(
        {
            getTranslations
        },
        dispatch
    );
};

const mapStateToProps = state => {
    return {
        translations: state.languages.translations,
        modal: state.languages.modal
        // dataMenu: state.pages.datas,
        // dataMenus: state.pages.data,
        // modal: state.pages.modal,
        // errors: state.pages.errors,
    }
};

export default connect(mapStateToProps, mapDispatchToProps)(TranslationsPage);
